import styled from 'styled-components';

export const Main = styled.main`
    width:100%;
    background-color:#eceae9;

    display:flex;
    justify-content:center;
    align-items:center;
`;

export const Content = styled.div`
    width:80%;
    border:1px solid black;
`;
